import React from 'react';
import './App.css';
import InputTag from './component/setInput.js';

class  App extends React.Component  {

  getWeather = (e) => {
    e.preventDefault();
    console.log("Hello");
  };

  render() {
    return (
      <div className="App">
        <InputTag methodWeather = {this.getWeather}/>
      </div>
    );
  }
}

export default App;
